(2, 'Báo cáo', 'Báo cáo nội bộ, ngày, tuần, tháng, đối tác ...', '2020-02-25 04:46:14', '2020-02-25 04:46:18', NULL),
(3, 'Báo cáo nội bộ', 'Lập báo cáo KQKD hàng tháng, quý, 06th, năm hoặc đột xuất theo yêu cầu của BGĐ, Báo cáo quản trị, báo cáo dòng tiền (lập KH dòng tiền), báo cáo đầu tư, báo cáo KQKD khác', '2020-02-25 04:46:14', '2020-02-25 04:46:18', NULL),
(4, 'Báo cáo thuế', 'Lập báo cáo, tờ khai thuế hàng tháng, quý, năm hoặc từng lần phát sinh, lập dự toán thuế hàng tháng', '2020-02-25 04:46:14', '2020-02-25 04:46:18', NULL),
