(7, 'C&B', 'Hợp đồng LĐ, QĐ, T/b, công văn các loại, chấm công, tính lương, OT...', '2020-02-25 04:46:14', '2020-02-25 04:46:18', NULL),
(8, 'Check duyệt hồ sơ, chứng từ', 'Check hồ sơ thanh toán, tạm ứng, hoàn ứng, check hợp đồng, check thông tin hóa đơn, chứng từ, phiếu thu - chi, check hồ sơ khác', '2020-02-25 04:46:14', '2020-02-25 04:46:18', NULL),
(9, 'Công tác', 'đi công tác', '2020-02-25 04:46:14', '2020-02-25 04:46:18', NULL),
