(11, 'Deadline hợp đồng, thầu bè, đối tác', '', '2020-02-25 04:46:14', '2020-02-25 04:46:18', NULL),
(12, 'Dự báo', 'Theo dõi dữ liệu thời tiết, mô hình, làm tin dự báo thời tiết, Dự báo Thủy văn', '2020-02-25 04:46:14', '2020-02-25 04:46:18', NULL),
